import React from "react";
import { Container, Row, Col } from 'react-bootstrap';
import serving from '../../../images/servings0.png';
import kcal from '../../../images/Kcal.png';

export default function ServingCounter() {
    return (
    <div>
        <Container>
            <Row>
                <Col> 
                <img className="servings" style={{ height: '400px', width: '400px' }} 
                src={serving} alt="center page logo" />
                <button className="serving-amount">veg: 6</button>
                <button className="serving-amount">fruit: 4</button>
                <button className="serving-amount">grains: 5</button>
                <button className="serving-amount">meats: 3</button>
                <button className="serving-amount">sweets: 0</button>
                <button className="serving-amount">fats: .25</button>
                <button className="serving-amount">dairy: 2</button>
                </Col>
                <Col>
                <img style={{ height: '400px', width: '400px' }} 
                src={kcal} alt="center page logo" />
                 </Col>
                <Col> </Col>
            </Row>
        </Container>
    </div>
    )
}
